import React, { Component } from 'react'
import Footer from './Footer'

export class Contact extends Component {
    render() {
        return (
            <div className="contactMePage">
                <h2>Contact Me</h2>
                <div></div><a href="mailto:ajzajac@icloud.com">Email</a>  
                <Footer></Footer>
            </div>
        )
    }
}

export default Contact
